import React from "react";
import app from "../../../../routes/routes";
import "./style.css";

class ListItems extends Component {
    state = {
      plants: [],
      name: "",
      common: "",
      
    };
  
    componentDidMount() {
      this.loadPlants();
    }
  
    loadPlants = () => {
      app.getGenus()
        .then(res =>
          this.setState({ plants: res.data, name: "", common: "" })
        )
        .catch(err => console.log(err));
    };
  
    render() {
      return (
        <div id="list-items">

        </div>
      );
    }
  }
  
  export default ListItems;
